import React, { useState } from "react";

const Liked = ({ likedItems: initialLikedItems }) => {
  const [likedItemsState, setLikedItemsState] = useState(initialLikedItems);

  return (
    <div>
      <h2>Liked Items</h2>
      <ul>
        {likedItemsState.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default Liked;
